import { useState } from "react";
import "./App.css";

function App() {
    const [activeImage, setactiveImaga] = useState("gking1.png");

    return (
        <div className="App">
            <section className="app-header">
                <div className="logo-gking">
                    <img src="logoG" alt="" />
                </div>
                <div className="header-text"></div>
                <div className="header-item">
                    <div className="header-item-img">
                        <img
                            className={
                                activeImage === "gking1.png" ? "active" : ""
                            }
                            src="gking1.png"
                            onClick={() => setactiveImaga("gking1.png")}
                        />
                    </div>
                    <div className="header-item-img">
                        <img
                            className={
                                activeImage === "Gking2.png" ? "active" : ""
                            }
                            src="Gking2.png"
                            onClick={() => setactiveImaga("Gking2.png")}
                        />
                    </div>

                    <div className="header-item-img">
                        <img
                            className={
                                activeImage === "gking3.png" ? "active" : ""
                            }
                            src="gking3.png"
                            onClick={() => setactiveImaga("gking3.png")}
                        />
                    </div>
                </div>
                <div className="img">
                    <img src={activeImage} />
                </div>
            </section>
        </div>
    );
}

export default App;
